import React, {useEffect, useState} from 'react';
import axios from 'axios';

export default function TransactionList(){

    const [ transactionList, setTransactionList ] = useState([])

    useEffect(() => {
        axios.get("http://localhost:3001/transaction/list")
        .then((response) => {
            setTransactionList(response.data)
        })
    }, [])

    return(
        <div>
            {transactionList.map((value,key) => {
                return(
                    <div className='transaction--cards'>
            <div className='transactions'>
                <h2 className='concept'>Concept</h2>
                <h6 className='date'>14/09/2022</h6>
                <h6 className='type'>Your Income was: $1212(amount)</h6>
                <p className='comment'>lorem ipsumlksafhslfhk</p>
            </div>
        </div>
                )
            })}
        </div>
        
        
    )
}

